function onToggle (e) {
   // e.preventDefault();
    console.log('I was clicked.')
    //console.log(e);
    if ( Element.children.length > 1) {}
}

function NodeComponent(props) { 
const dataModel = props.dataModel;
//console.log(dataModel)
  return <div>
      <div>
          <li><h2 className="nodeName" onClick={onToggle}>  <span className="glyphicon glyphicon-chevron-down"></span>{dataModel.name}</h2></li>
         <div className="nodeChildren">  {dataModel.children.map((child) =>
        <NodeComponent dataModel={child} />)}
           </div> 
      </div>
  </div>
}

export default NodeComponent;
